import React, { useEffect } from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import MyLikeMovieCard from "../mymovielist/MyLikeMovieCard";
import { useSelector, useDispatch } from "react-redux";
import { getMypage } from "../../redux/modules/movies";

const MyLikeMovies = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const { isLoading, error, mylist } = useSelector((state) => state.movies);

  useEffect(() => {
    dispatch(getMypage());
  }, [dispatch]);

  if (isLoading) {
    return <div>로딩 중....</div>;
  }

  if (error) {
    return <div>{error.message}</div>;
  }

  return (
    <div>
      <Container>
        <Contents>
          {/*사이드바 start*/}
          <ColsContent>
            <ColSideBar>
              <Profile>
                <ProfileInner>
                  <ProfileContents>
                    <ImageBox>
                      <ThumbImage></ThumbImage>
                    </ImageBox>
                    <BoxContent>
                      <Strong>{mylist.name}</Strong>
                      <Div></Div>
                    </BoxContent>
                  </ProfileContents>
                </ProfileInner>
              </Profile>
              <LikeBtn>
                {/*좋아요 누른 영화 숫자 들어갈 자리*/}
                <Howmany>{mylist.countLike}</Howmany>
                {/*좋아요 누른 영화 숫자 들어갈 자리*/}
                <P>기대되는 영화</P>
              </LikeBtn>
              <WatchedBtn
                onClick={() => {
                  navigate("/movielist");
                }}
              >
                {/*내가 본 영화 숫자 들어갈 자리*/}
                <Howmany>{mylist.countMovie}</Howmany>
                {/*내가 본 영화 숫자 들어갈 자리*/}
                <P>내가 본 영화</P>
              </WatchedBtn>
            </ColSideBar>
          </ColsContent>
          {/*사이드바 finish*/}
          <LikedMovies>
            {/*기대되는 영화 숫자 들어갈 자리*/}
            <LikedTitle>
              기대되는 영화<Howmany2>{mylist.countLike}건</Howmany2>
              {/*기대되는 영화 숫자 들어갈 자리*/}
              <Select name="movies" id="movies">
                <option value="등록일 순">등록일 순</option>
                <option value="개봉일 순">개봉일 순</option>
              </Select>
              {/*영화 년도별 or 등록일순 내림차순 오름차순*/}
              <GoBtn>GO</GoBtn>
              {/*영화 년도별 or 등록일순 내림차순 오름차순*/}
            </LikedTitle>
          </LikedMovies>
          <MovieDetail>
            <MovieList>
              {mylist?.likeMovies?.map((likeMovie) => (
                <MyLikeMovieCard likeMovie={likeMovie} key={likeMovie.id} /> // map 돌린 결과물 likeMovie를 props로 자식컴포넌트에 보내기
              ))}
            </MovieList>
          </MovieDetail>
        </Contents>
      </Container>
    </div>
  );
};

export default MyLikeMovies;
